import React, { useRef, useState } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
  const nav = useRef();
  const showNavbar = () => {
    nav.current.classList.toggle("responsive_nav");
  };
  return (
    <div>
      <div className="container" id="container">
        
        <nav>
        <img className="doglogo push" src="/doglogo.png" alt="logo"></img>
        <button onClick={showNavbar} className="loginn">Login</button>
        <button onClick={showNavbar} className="signupp">Sign Up</button>
        <button onClick={showNavbar} className="nav-btn nav-close-btn"><FaTimes /></button>
        </nav>
        <button onClick={showNavbar} className="nav-btn"><FaBars /></button>
      </div>
    </div>
  );
}

export default Navbar;
